import React from 'react';
import {Navbar, Nav} from 'react-bootstrap';
import logo from '../sbd_logo.svg';
import './Navigation.css';


const Navigation = () => (
    <Navbar collapseOnSelect expand="lg" className="nav" bg="light" variant="light">
        <Navbar.Brand href="/">
            <img src={logo} height="100" className="d-inline-block align-top" alt="SBD Logo" />
        </Navbar.Brand>
        <Nav className="ml-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/our-company">About</Nav.Link>
            <Nav.Link href="/services">Services</Nav.Link>
            <Nav.Link id="contact" href="/contact-us">Contact Us</Nav.Link>
        </Nav>
    </Navbar>
);

export default Navigation;
